function nav() {



    function isAccountEnabled(){
        const enabled = window.localStorage.getItem("name");
        if(enabled == "userThirteen"){
            return "/myAccount";
        } else {
            return "#0";
        }
    }
    function isAccountClassEnabled(){
            const classEnabled = window.localStorage.getItem("name");
            if(classEnabled == "userThirteen"){
                return "isDisabled";
            } else {
                return "";
            }
        }


    return (
        <div className = "nav">
            <ul className = "nav-ul">
                <li>
                    <a href="/home">home</a>      
                </li>
                <li>
                    <a href="/calanderView">Calander view</a>
                </li>
                <li>
                    <a class = {isAccountClassEnabled()} href={isAccountEnabled()}>my account</a>
                </li>
                <li>
                    <a class = "isDisabled">log out</a>
                </li>
            </ul>
        </div>

    )
}

export default nav
